import React from 'react';
import '../components.css';

const Movie = ({ children }) => {
  const listItems = children.map((child) =>
    <li key={child.toString()}>
      {child}
    </li>
  );
  return (
    <div className='result-demo'>
      <ul>{listItems}</ul>
    </div>
  );
};

export default Movie;
